import "./App.css";
import * as dfd from "danfojs";
import { useState } from "react";

function App() {
  const [workouts, changeWorkouts] = useState(null);

  const getWorkouts = async () => {
    let df = await dfd.readCSV(
      "/Users/omarbailey/Documents/Gym/Omar Random Workout Generator.csv"
    );
    return df;
  };

  changeWorkouts(getWorkouts());

  return (
    <div>
      <h1> Workout Generator</h1>
      <p>{workouts}</p>
    </div>
  );
}

export default App;
